(11, 'Rapat Mahasiswa', 'Gedung Rektor', 'BADAN PENGURUS HARIAN (10/03/2022) – HIMPUNAN MAHASISWA JURUSAN PENDIDIKAN MORAL PANCASILA DAN KEWARGAAN NEGARA (HMJ PMP-KN), Universitas Wakanda mengadakan kegiatan Rapat Kerja dan Upgrading yang bertemakan “Penguatan Profesionalitas dan Kualitas Fungsionaris HMJ PMP-KN Periode 2022 yang Berintegritas Guna Meningkatkan Solidaritas”. Pemilihan tema ini bertujuan untuk kebutuhan personal yang royal dan loyal, serta visi yang didasari oleh solidaritas. Selain itu, dalam berorganisasi harus bisa mengedepankan sikap pofesional dan berkualitas untuk menjadikan HMJ PMPK-KN yang lebih baik. Kegiatan ini merupakan kegiatan wajib sebagai tanda peresmian fungsionaris dan diselenggarakan selama dua hari, yaitu pada tanggal 4-5 Januari 2022 secara offline di Ruang I2.02.03 Administrasi Negara dan Gedung I6 Aula Srikandi Fakultas Ilmu Sosial dan Hukum serta di lakukan online via zoom meeting.', '2022-07-09', '12:00', 1, '2022-07-04 14:56:12', NULL),
